import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with longer timeout
    await page.goto(fileUrl, { timeout: 60000 });
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Get all add-to-cart buttons
    const addToCartButtons = await page.$$('.add-to-cart');

    // Perform rapid cart additions
    let cartCount = 0;
    const cartUpdates = [];

    for (let i = 0; i < Math.min(5, addToCartButtons.length); i++) {
      // Click add to cart button
      await addToCartButtons[i].click();

      // Wait for potential cart update animation
      await page.waitForTimeout(300);

      // Get current cart count from the DOM
      const cartText = await page.$eval('.cart', el => el.textContent.trim());
      const currentCount = parseInt(cartText.match(/\d+/)?.[0] || '0');

      cartUpdates.push({
        productIndex: i,
        cartCount: currentCount
      });

      cartCount = currentCount;
    }

    // Take screenshot after cart operations
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_updated.png'));

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test by adding multiple items to cart",
      extractedData: {
        initialCartCount: 0,
        finalCartCount: cartCount,
        itemsAdded: cartUpdates.length,
        cartUpdates: cartUpdates
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
